import React, { useEffect, useState } from "react";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, PieChart, Pie, Cell, Legend } from "recharts";
import { Clock, ArrowLeft } from "lucide-react";
import { Link } from "react-router-dom";
import { apiService } from "./apiService"; // ✅ make sure project.jsx exports apiService

const COLORS = ["#3b82f6", "#f59e0b", "#ef4444", "#10b981"];

export default function AnalyticsDashboard() {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // ✅ add getAnalytics() to apiService in project.jsx
        const data = await apiService.getAnalytics();
        setAnalytics(data);
      } catch (err) {
        console.error("Failed to load analytics:", err);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  if (loading) return <p className="p-6">Chargement des analytics...</p>;
  if (!analytics) return <p className="p-6">Aucune donnée disponible</p>;

  return (
    <div className="jira-container space-y-6">
      {/* Back Button */}
      <div className="flex items-center gap-3">
        <Link to="/" className="jira-btn jira-btn-secondary">
          <ArrowLeft size={18} />
          Retour aux Tickets
        </Link>
      </div>

      {/* KPI Card */}
      <div className="jira-card shadow-md">
        <div className="jira-card-body flex items-center justify-between">
          <div>
            <h2 className="text-lg font-semibold text-gray-600">Temps moyen de résolution</h2>
            <p className="text-2xl font-bold text-blue-600">{analytics.avg_resolution_time} jours</p>
          </div>
          <Clock size={40} className="text-blue-500" />
        </div>
      </div>

      {/* Bar Chart - Tickets per Week */}
      <div className="jira-card shadow-md">
        <div className="jira-card-body">
          <h2 className="text-lg font-semibold text-gray-600 mb-4">Tickets par semaine</h2>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={analytics.tickets_per_week}>
              <XAxis dataKey="week" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="count" fill="#3b82f6" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>

      {/* Pie Chart - Priority Distribution */}
      <div className="jira-card shadow-md">
        <div className="jira-card-body">
          <h2 className="text-lg font-semibold text-gray-600 mb-4">Répartition par priorité</h2>
          <ResponsiveContainer width="100%" height={300}>
            <PieChart>
              <Pie
                data={Object.entries(analytics.priority_distribution).map(([key, value]) => ({ name: key, value }))}
                dataKey="value"
                nameKey="name"
                cx="50%"
                cy="50%"
                outerRadius={100}
                label
              >
                {Object.entries(analytics.priority_distribution).map(([key], index) => (
                  <Cell key={key} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
              <Legend />
              <Tooltip />
            </PieChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
}
